import React from 'react';
import TigranTumoImg from '../../assets/images/TigranTumo.jpg';
import s from './Proficiency.module.css';

function Proficiency() {
    return (
        <div id='profilciency' className={s.body}>
            {/*my image*/}
            <img id={s.my_image} src="https://www.kindpng.com/picc/m/370-3705520_01-desktop-programmer-programming-flowchart-clipart-technology-vector.png" alt="" />

            <div className={s.left_div}>
                {/*header*/}
                <span id={s.header}>Proficiency</span>
                <br />
                <span>HTML CSS</span>
                <br />
                <progress id="file" value="85" max="100"></progress>
                <span>JavaScript</span>
                <br />
                <progress id="file" value="60" max="100"></progress>
                <span>Jquery</span>
                <br />
                <progress id="file" value="60" max="100"></progress>
                <span>React</span>
                <br />
                <progress id="file" value="30" max="100"></progress>
                <span>Wordpress</span>
                <br />
                <progress id="file" value="30" max="100"></progress>
            </div>
        </div>
    );
}

export default Proficiency;
